// ==/UserScript==

var eLStyle = '<style>.switch {  position: relative;  display: inline-block;  width: 195px;  height: 34px;}.switch input {display:none;}.slider {  position: absolute;  cursor: pointer;  top: 0;  left: 0;  right: 0;  bottom: 0;  background-color: #2ab934;  -webkit-transition: .4s;  transition: .4s;   border-radius: 34px;}.slider:before {  position: absolute;  content: "";  height: 26px;  width: 26px;  left: 4px;  bottom: 4px;  background-color: white;  -webkit-transition: .4s;  transition: .4s;  border-radius: 50%;}input:checked + .slider {  background-color: #00743D;}input:focus + .slider {  box-shadow: 0 0 1px #2196F3;}input:checked + .slider:before {  -webkit-transform: translateX(26px);  -ms-transform: translateX(26px);  transform: translateX(162px);}.slider:after{ content:"Amazon Fresh"; color: white; display: block; position: absolute; transform: translate(-50%,-50%); top: 50%; left: 50%; font-size: 12px; font-family: Verdana, sans-serif;}input:checked + .slider:after{  content:"Whole Foods";}.switcheLToggldOnBttn {  position: relative;  display: inline-block;  width: 83px;  height: 34px;}.switcheLToggldOnBttn input {display:none;}.sliderseLToggldOnBttn {  position: absolute;  cursor: pointer;  top: 0;  left: 0;  right: 0;  bottom: 0;  background-color: #797979;  -webkit-transition: .4s;  transition: .4s;   border-radius: 34px;}.sliderseLToggldOnBttn:before {  position: absolute;  content: "";  height: 26px;  width: 26px;  left: 4px;  bottom: 4px;  background-color: white;  -webkit-transition: .4s;  transition: .4s;  border-radius: 50%;}input:checked + .sliderseLToggldOnBttn {  background-color: #2ab934;}input:focus + .sliderseLToggldOnBttn {  box-shadow: 0 0 1px #2196F3;}input:checked + .sliderseLToggldOnBttn:before {  -webkit-transform: translateX(26px);  -ms-transform: translateX(26px);  transform: translateX(50px);}.sliderseLToggldOnBttn:after{ content:"OFF"; color: white; display: block; position: absolute; transform: translate(-50%,-50%); top: 50%; left: 50%; padding-left: 15px; transition: padding 0.3s ease-in 0s font-size: 16px; color: white; font-family: Trebuchet, Arial, sans-serif; font-weight: bold; box-sizing: border-box;}input:checked + .sliderseLToggldOnBttn:after{  content:"ON";  padding-Right: 25px;  transition: padding 0.3s ease-in 0s}</style>';


if(GM_getValue("MarketPlace") == null){GM_setValue("MarketPlace", 0)};
if(GM_getValue("SlotFinder") == null){GM_setValue("SlotFinder", 0)};
if (GM_getValue("MarketPlace") == 1){var elChckBx = " checked"};
if (GM_getValue("SlotFinder") == 1){var elOnChckBx = " checked"}else{var elChckBxhide = ' style="display: none;" '};

const NeedToLogON = document.querySelector("body > div > div > div#authportal-center-section > div#authportal-main-section.a-section");




if(NeedToLogON){
    alert("you need to logon")
}else{
    //alert("No Need to LogON")
    var eLverifyingTxt = ["Checkout Amazon Fresh Cart","Continue","Checkout Whole Foods Market Cart"];
    var sanity = ["Not available","Schedule your order","Before you checkout"];

    const CheckOUtBttn = $("input.a-button-input");
    //const AmzFrshCrtPage = document.querySelector("div.a-box-group > div#sc-expanded-cart-localmarket.a-section.sc-localmarket-collapsed-cart.sc-localmarket-cart.sc-localmarket-fresh.sc-localmarket-expanded-cart");
    const AmzFrshCrtPage = document.querySelector("div#localmarket-full-cart");
    const AmzFrshChkoUtbTtn = document.querySelector("#sc-alm-buy-box-ptc-button-QW1hem9uIEZyZXNo");
    const CheckOUtBttnCtnlNk = document.querySelector("div.a-box-inner > span#a-autoid-0 > span.a-button-inner a");
    const AmzYourStr = document.querySelector("div#ys-center > div.welcome-msg");

    var schdlOrderText = $("h1").text().replace('\n','').trim();
    var AudioAlertSrc = "data:audio/mp3;base64," + ""
    var AudioAlertCode = '<audio id="myAudio"><source src="' + AudioAlertSrc + '" type="audio/mpeg" ></audio>';
    var reLoadPageCode = '<button id="mirFrshBttn" style="display:none" type="button" onclick="reloadPage();">Reload page</button>';
    var eLOnToggldBttnCode = '<label class="ufss-grid-row-title" style="color: #C02F2D;text-decoration: underline;text-decoration-color: #3c6488;font-size: 160%;text-align: center;display: inline-block;padding-bottom: 45px;height: 26px;vertical-align: middle;">Delivery Slot Finder&nbsp;&nbsp;</label><label class="switcheLToggldOnBttn"><input type="checkbox" id="eLToggldOnBttn"'+elOnChckBx+'><span class="sliderseLToggldOnBttn round"></span></label>&nbsp;&nbsp;'
    var eLToggldBttnCode = '<label class="switch"'+elChckBxhide+'><input type="checkbox" id="eLToggldBttn"'+elChckBx+'><span class="slider round"></span></label>';
    var elSettingevrywr = 0;

   if (elSettingevrywr == 0){
       console.log(schdlOrderText);
       if((schdlOrderText == sanity[2])||(schdlOrderText == sanity[1])){$('h1').eq(0).before(eLStyle + eLOnToggldBttnCode)};
       if(AmzFrshCrtPage !== null){$('div#localmarket-full-cart').before(eLStyle + eLOnToggldBttnCode)};
       $("div#ys-center > div.welcome-msg").before(eLStyle + eLOnToggldBttnCode);
   };


    if (document.querySelector('div.a-row.sc-localmarket-container') !== null){$('div.a-row.sc-localmarket-container').before(eLStyle + eLOnToggldBttnCode + eLToggldBttnCode )}else{};



    var dt = new Date();
    function iLZero(i) {if (i < 10) {i = "0" + i;}return i;};
    var time = iLZero(dt.getHours()) + ":" + iLZero(dt.getMinutes()) + ":" + iLZero(dt.getSeconds());
    var reLoadTm = (Math.floor(Math.random() * (65000 - 57000) ) + 57000);
    var eLlstRfrshTmCode = '<div id="progressBarTxt"'+elChckBxhide+'><h4 class="a-alert-heading">Countdown to Auto refresh  0 <progress value="0" max="'+(reLoadTm/1000).toFixed(0)+'" id="progressBar"></progress> '+(reLoadTm/1000).toFixed(0)+' Seconds</h4></div><br>';



    if(($("span.ufss-slot-time-window-text").text().replace("\n","").trim()) && schdlOrderText == sanity[1]){
        $("h1").eq(0).after(AudioAlertCode);
        var aud = document.getElementById("myAudio");
        aud.volume = 1;
        console.log(time);
        $(function(){
            function AlertLoop() {
                if (GM_getValue("SlotFinder") == 1){aud.play()};
                setTimeout(AlertLoop,1000);
            }
            AlertLoop();
        });
    }
    else if (schdlOrderText == sanity[1]){
        $("h1").eq(0).after(reLoadPageCode);
        $("#mirFrshBttn").after(eLlstRfrshTmCode);

        var timeleft = 1;
        document.getElementById("progressBar").value = ((reLoadTm/1000).toFixed(0))
        var ReloadTimer = setInterval(function(){
            if(timeleft >= ((reLoadTm/1000).toFixed(0))){
                clearInterval(ReloadTimer);
            }
            document.getElementById("progressBar").value = ((reLoadTm/1000).toFixed(0)) - timeleft;
            timeleft += 1;
        }, 1000);

        console.log(time);
        setTimeout(function(){if (GM_getValue("SlotFinder") == 1){$('#mirFrshBttn').click();}}, reLoadTm);
        //setTimeout(function(){window.location.href = "https://www.amazon.com/cart/fresh";}, reLoadTm);
    }
    else if (AmzFrshChkoUtbTtn !== null){
       var AmzFrshChkoUtbTtnTxt = $(AmzFrshChkoUtbTtn.querySelector("span.a-button-text")).text().replace('\n','').trim()
       var AmzFrshChkoUtbTtlNk = AmzFrshChkoUtbTtn.querySelector("input.a-button-input")
       if(AmzFrshCrtPage !== null){if(AmzFrshChkoUtbTtnTxt == eLverifyingTxt[0] || AmzFrshChkoUtbTtnTxt == eLverifyingTxt[2]){console.log(AmzFrshChkoUtbTtnTxt);setTimeout(function(){if (GM_getValue("SlotFinder") == 1){AmzFrshChkoUtbTtlNk.click();}}, 3000);}};
    }
    //Continue to Chart form Before you checkout page
    else if (schdlOrderText = sanity[2] && CheckOUtBttnCtnlNk !== null){
        var CheckOUtBttnCtnTxt = $(CheckOUtBttnCtnlNk).text().replace('\n','').trim();
        if(CheckOUtBttnCtnTxt == eLverifyingTxt[1]){console.log(CheckOUtBttnCtnTxt);setTimeout(function(){if (GM_getValue("SlotFinder") == 1){CheckOUtBttnCtnlNk.click();}}, 3000);};
    }
    //Restart Checkout sequence if Amazon redirects to YourStore page
    else if (AmzYourStr !== null){
        $(window).on("load", function() {
            if(GM_getValue("MarketPlace") == 0){
                setTimeout(function(){if (GM_getValue("SlotFinder") == 1){window.location.href = "https://www.amazon.com/cart/fresh";}}, 3000);
            }
            else if(GM_getValue("MarketPlace") == 1){
                setTimeout(function(){if (GM_getValue("SlotFinder") == 1){window.location.href = "https://www.amazon.com/cart/localmarket";}}, 3000);
            }
            else {
                setTimeout(function(){if (GM_getValue("SlotFinder") == 1){window.location.href = "https://www.amazon.com/gp/cart/view.html";}}, 3000);
                //setTimeout(function(){if (GM_getValue("SlotFinder") == 1){window.location.href = "https://www.amazon.com/gp/buy/shipoptionselect/handlers/display.html";}}, 3000);
            };
        });
    };

};

$('#mirFrshBttn').click(function() {location.reload(true);});

$('input#eLToggldBttn').click(function() {
    if(GM_getValue("MarketPlace") == 1){GM_setValue("MarketPlace", 0)}else{GM_setValue("MarketPlace", 1)};
});

$('input#eLToggldOnBttn').click(function() {
    if(GM_getValue("SlotFinder") == 1){
        GM_setValue("SlotFinder", 0);
        $("#progressBarTxt").hide(500);
        $(".switch").hide(500);
    }else{
        GM_setValue("SlotFinder", 1);
        if(($("span.ufss-slot-time-window-text").text().replace("\n","").trim()) && schdlOrderText == sanity[1]){
        }else if (schdlOrderText == sanity[1]){
            location.reload(true);
        }else{
            window.location.href = "https://www.amazon.com/gp/cart/view.html";
        }
    };
});


